import React from 'react';
import Blogs from './Blogs/Blogs';

function Home() {
  return (
    <div className="container">
      {/* First Defrate Section */}
      <section className="defrate-section mt-3 d-flex" id="defrate-section-one">
        <div className="defrate-content">
          <h3>Welcome to My First Defrate Section</h3>
          <p>This section provides an overview of my first topic.</p>
        </div>
        <div className="defrate-img">
          <img src={require('./Images/Images.png')} alt="Defrate Image 1" />
        </div>
      </section>

      {/* Second Defrate Section */}
      <section className="defrate-section mt-3 d-flex" id="defrate-section-two">
        <Blogs />
      </section>
    </div>
  );
}

export default Home;
